// BookController.js

import TransApi from "../callAPI/trans";

const TransController = {
    getAllTrans_Activie: async () => {
        try {
            const alltrans = await TransApi.getAllTrans();
            // Xử lý dữ liệu nếu cần
            return alltrans.transactionStatus === "Active";
        } catch (error) {
            // Xử lý lỗi nếu cần
            console.error("Error in getting all books:", error);
            throw error;
        }
    },
    // Các hàm controller khác có thể được thêm ở đây
};

export default TransController;
